import React from 'react';

const SearchJobs: React.FC = () => {
  return (
    <div className="bg-gradient-to-br from-purple-50 to-purple-100 rounded-xl p-8 shadow-card">
      <h1 className="text-4xl font-bold text-primary-purple text-center mb-8">Search Jobs</h1>
      <div className="max-w-2xl mx-auto">
        <div className="relative">
          <input
            type="text"
            placeholder="Search jobs by title, company or skill"
            className="w-full px-6 py-4 text-lg rounded-full border border-gray-200 focus:outline-none focus:ring-2 focus:ring-primary-purple focus:border-transparent shadow-sm"
          />
          <button className="absolute right-2 top-1/2 transform -translate-y-1/2 bg-primary-purple text-white p-3 rounded-full hover:bg-purple-700 transition-colors">
            <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
            </svg>
          </button>
        </div>
      </div>
    </div>
  );
};

export default SearchJobs;
